interface SkillItemProps {
  name: string;
  image: string;
  alt?: string;
  className?: string;
}

export default function SkillItem({ name, image, alt, className = "" }: SkillItemProps) {
  return (
    <div className={`flex items-center space-x-3 ${className}`}>
      <div className="w-8 md:w-20 h-8 md:h-20 flex-shrink-0">
        <img
          src={`/images/logo/${image}`}
          alt={alt || name}
          className="w-full h-full object-contain"
        />
      </div>
      {/* <span className="text-sm text-gray-200">{name}</span> */}
    </div>
  );
}
